// Localisation.js
import React from "react";
import ExpandableSection from "./ExpandableSection";

// Déclarer le composant Localisation qui prend en paramètre un objet contenant la propriété "location"
export const Localisation = ({ location }) => {
  // Retourner un composant ExpandableSection contenant les informations de localisation
  return (
    <ExpandableSection title="Localisation">
      {/* Créer un élément div pour contenir les informations de localisation */}
      <div>
        {/* Afficher la localisation dans un élément <p> */}
        <p>{location}</p>
      </div>
    </ExpandableSection>
  );
};
